// src/pages/Achievements.js
import React from 'react';
import Card from '../components/Card';
import './Achievements.css';

const Achievements = () => {
  const achievements = [
    { title: 'Award 1', description: 'Description of Award 1', image: '/assets/images/achievement1.png' },
    { title: 'Award 2', description: 'Description of Award 2', image: '/assets/images/achievement2.png' }
  ];

  return (
    <div className="achievements">
      <h1>My Achievements</h1>
      <div className="card-container">
        {achievements.map((ach, index) => (
          <Card key={index} {...ach} />
        ))}
      </div>
    </div>
  );
};

export default Achievements;
